import "../styles/start.css";

function Start() {
    return (
        <div>
            <div id="imgWrapper">
                <div id="backgroundGradient"></div>
                <img id="backgroundImg" src="/images/gym3.jpg" alt="Dumbells"></img>
                <h1>The best service for your fitness journey</h1>
            </div>
        </div>
    );
}

export default Start;
